// Carousel Component
import { Carousel } from "@material-tailwind/react";

function CarouselMenue(){
    return(
        <Carousel className="rounded-xl">
            <img src="/images/AM.png" alt="AM" className="h-full w-full object-cover" />
        </Carousel>
    );
}

export default CarouselMenue;
